-- -----------------------------------------------------
-- Schema online_auctions_db
-- -----------------------------------------------------
DROP SCHEMA IF EXISTS `online_auctions_db`;
CREATE SCHEMA `online_auctions_db` DEFAULT CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci ;
USE `online_auctions_db` ;

-- -----------------------------------------------------
-- Table `user`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS `user` (
  `id` INT NOT NULL AUTO_INCREMENT,
  `username` VARCHAR(45) NOT NULL,
  `password` VARCHAR(255) NOT NULL,
  `name` VARCHAR(45) NOT NULL,
  `surname` VARCHAR(45) NOT NULL,
  `shippingAddress` VARCHAR(255) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE INDEX `username_UNIQUE` (`username` ASC) VISIBLE)
ENGINE = InnoDB;

-- -----------------------------------------------------
-- Table `item`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS `item` (
  `id` INT NOT NULL AUTO_INCREMENT,
  `itemCode` VARCHAR(50) NOT NULL,
  `name` VARCHAR(100) NOT NULL,
  `description` TEXT NOT NULL,
  `image` LONGBLOB NOT NULL,
  `basePrice` DECIMAL(10,2) NOT NULL,
  `sellerUserId` INT NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE INDEX `itemCode_UNIQUE` (`itemCode` ASC) VISIBLE,
  INDEX `fk_item_user_idx` (`sellerUserId` ASC) VISIBLE,
  CONSTRAINT `fk_item_user`
    FOREIGN KEY (`sellerUserId`)
    REFERENCES `user` (`id`)
    ON DELETE CASCADE
    ON UPDATE NO ACTION)
ENGINE = InnoDB;

-- -----------------------------------------------------
-- Table `auction`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS `auction` (
  `id` INT NOT NULL AUTO_INCREMENT,
  `initialPrice` DECIMAL(10,2) NOT NULL,
  `minimumBidIncrement` DECIMAL(10,2) NOT NULL,
  `deadline` TIMESTAMP NOT NULL,
  `creationTimestamp` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `creatorUserId` INT NOT NULL,
  `status` VARCHAR(10) NOT NULL COMMENT 'Possible values: OPEN, CLOSED',
  `winnerUserId` INT NULL DEFAULT NULL,
  `winningPrice` DECIMAL(10,2) NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  INDEX `fk_auction_creator_user_idx` (`creatorUserId` ASC) VISIBLE,
  INDEX `fk_auction_winner_user_idx` (`winnerUserId` ASC) VISIBLE,
  CONSTRAINT `fk_auction_creator_user`
    FOREIGN KEY (`creatorUserId`)
    REFERENCES `user` (`id`)
    ON DELETE CASCADE
    ON UPDATE NO ACTION,
  CONSTRAINT `fk_auction_winner_user`
    FOREIGN KEY (`winnerUserId`)
    REFERENCES `user` (`id`)
    ON DELETE SET NULL
    ON UPDATE NO ACTION)
ENGINE = InnoDB;

-- -----------------------------------------------------
-- Table `auction_item_link`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS `auction_item_link` (
  `auction_id` INT NOT NULL,
  `item_id` INT NOT NULL,
  PRIMARY KEY (`auction_id`, `item_id`),
  INDEX `fk_link_item_idx` (`item_id` ASC) VISIBLE,
  INDEX `fk_link_auction_idx` (`auction_id` ASC) VISIBLE,
  CONSTRAINT `fk_link_auction`
    FOREIGN KEY (`auction_id`)
    REFERENCES `auction` (`id`)
    ON DELETE CASCADE
    ON UPDATE NO ACTION,
  CONSTRAINT `fk_link_item`
    FOREIGN KEY (`item_id`)
    REFERENCES `item` (`id`)
    ON DELETE CASCADE
    ON UPDATE NO ACTION)
ENGINE = InnoDB;

-- -----------------------------------------------------
-- Table `bid`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS `bid` (
  `id` INT NOT NULL AUTO_INCREMENT,
  `auctionId` INT NOT NULL,
  `userId` INT NOT NULL,
  `amount` DECIMAL(10,2) NOT NULL,
  `timestamp` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  INDEX `fk_bid_auction_idx` (`auctionId` ASC) VISIBLE,
  INDEX `fk_bid_user_idx` (`userId` ASC) VISIBLE,
  CONSTRAINT `fk_bid_auction`
    FOREIGN KEY (`auctionId`)
    REFERENCES `auction` (`id`)
    ON DELETE CASCADE
    ON UPDATE NO ACTION,
  CONSTRAINT `fk_bid_user`
    FOREIGN KEY (`userId`)
    REFERENCES `user` (`id`)
    ON DELETE CASCADE
    ON UPDATE NO ACTION)
ENGINE = InnoDB;

